// src/pages/Projects.js
import React from 'react';
import './projects.scss';

function Projects() {
    return (
        <div className="projects">
            <h2>My Projects</h2>
            <ul>
                <li>Project 1</li>
                <li>Project 2</li>
                <li>Project 3</li>
            </ul>
        </div>
    );
}

export default Projects;
